export const COLUMNS = [
  {
    Header: `Name`,
    accesor: `name`,
  },
  {
    Header: `Country`,
    accesor: `country`,
  },
  {
    Header: `Latitude`,
    accesor: `lat`,
  },
  {
    Header: `Longitude`,
    accesor: `long`,
  },
  {
    Header: `Wind Prob.`,
    accesor: `probability`,
  },
  {
    Header: `When to go`,
    accesor: `month`,
  },
];
